import React from 'react';
import ReminderItem from './ReminderItem';

const sampleReminders = [
  {
    id: 1,
    title: 'Water the plants',
    description: 'Remember to water the plants every morning.',
    date: '2024-06-01',
  },
  {
    id: 2,
    title: 'Fertilize garden',
    description: 'Apply fertilizer to the garden this weekend.',
    date: '2024-06-05',
  },
  {
    id: 3,
    title: 'Prune roses',
    description: 'Prune the rose bushes to encourage growth.',
    date: '2024-06-10',
  },
];

const ReminderList = () => {
  return (
    <div>
      <h2>Reminder List</h2>
      {sampleReminders.map((reminder) => (
        <ReminderItem
          key={reminder.id}
          title={reminder.title}
          description={reminder.description}
          date={reminder.date}
        />
      ))}
    </div>
  );
};

export default ReminderList;
